%%sql
--auxiliary table
drop table IF EXISTS toIngest;
create table  toIngest (playerID string, teamID string);
insert into toIngest values ('pombo','sporting');
insert into toIngest values ('andy','springboks');

%%pyspark
import delta 
AllstarFull = delta.DeltaTable.forPath(spark,"abfss://deltamigration@pomboadlsgen22.dfs.core.windows.net/AllstarFull")
toIngest = spark.table("toIngest")
AllstarFull.alias("AllstarFull").merge(
    source = toIngest.alias("toIngest"),
    condition = "toIngest.playerID = AllstarFull.playerID"
  ).whenMatchedUpdate(set =
    {
      "teamID": "toIngest.teamID"
    }
  ).whenNotMatchedInsert(values =
    {
      "playerID": "toIngest.playerID",
      "teamID": "toIngest.teamID",
    }
  ).execute()
